import React from 'react'

const Filmlist = (props) => {
    return (
        <div className="film-list">
            <h1 className="section-title">{props.D.map(element => 
     <p filmId={element.films.id}></p>)}
    </h1>
        </div>
    )
}

export default Filmlist
